),(163,1,'created','2023-02-07 11:53:06.147448','2023-02-07 11:53:06.147450',82,2,'Save registration','',163,'SAVE',0),(164,1,'created','2023-02-07 11:53:07.621457','2023-02-07 11:53:07.621459',83,1,'LÆS MERE','',164,NULL,0),(165,1,'created','2023-02-07 11:53:07.684857','2023-02-07 11:53:07.684859',83,2,'READ MORE','',165,NULL,0),(166,1,'created','2023-02-07 11:53:07.951308','2023-02-07 11:53:07.951311',84,1,'INFO','Opbevaring af foder skal ske på en måde, så tilhold af skadedyr forebygges, og spild ikke giver anledning til punktforurening.  <br><br>Dette forebygges ved at sikre, at foder opbevares i tætte og dertil egnede beholdere.<br><br>Der vil kunne ske spild af foder fx ved utætte samlinger, levering/indblæsning af foder eller lignende. Sker der spild af foder, er det vigtigt, at der løbende bliver samlet op, så fx tilhold af rotter undgås.',166,NULL,0),(167,1,'created','2023-02-07 11:53:08.116392','2023-02-07 11:53:08.116394',84,2,'INFO','<br>Feed must be stored in such a way that pests are prevented and spills do not give rise to point pollution.<br><br>This is prevented by ensuring that feed is stored in tight and suitable containers.<br><br>There may be a waste of feed, for example by leaky joints, delivery / supply of feed or the like. If there is a waste of feed, it is important that it is collected regularly, so that, for example, the presence of rats is avoided.',167,NULL,0),(168,1,'created','2023-02-07 11:53:08.484007','2023-02-07 11:53:08.484009',85,1,'Ingen foderspild','',168,NULL,0),(169,1,'created','2023-02-07 11:53:08.562387','2023-02-07 11:53:08.562388',85,2,'No feed spills','',169,NULL,0),(170,1,'created','2023-02-07 11:53:08.743183','2023-02-07 11:53:08.743185',86,1,'Rørsamlinger tætte','',170,NULL,0),(171,1,'created','2023-02-07 11:53:08.847883','2023-02-07 11:53:08.847885',86,2,'Pipe joints tight','',171,NULL,0),(172,1,'created','2023-02-07 11:53:08.970653','2023-02-07 11:53:08.970655',87,1,'Billede','',172,NULL,0),(173,1,'created','2023-02-07 11:53:09.012974','2023-02-07 11:53:09.012976',87,2,'Picture','',173,NULL,0),(174,1,'created','2023-02-07 11:53:09.068309','2023-02-07 11:53:09.068311',88,1,'Kommentar','',174,'',0),(175,1,'created','2023-02-07 11:53:09.087269','2023-02-07 11:53:09.087272',88,2,'Comment','',175,'',0),(176,1,'created','2023-02-07 11:53:09.274534','2023-02-07 11:53:09.274536',89,1,'Gem registrering','',176,'GEM',0),(177,1,'created','2023-02-07 11:53:09.312811','2023-02-07 11:53:09.312814',89,2,'Save registration','',177,'SAVE',0),(178,1,'created','2023-02-07 11:53:10.661892','2023-02-07 11:53:10.661894',90,1,'LÆS MERE','',178,NULL,0),(179,1,'created','2023-02-07 11:53:10.785501','2023-02-07 11:53:10.785503',90,2,'READ MORE','',179,NULL,0),(180,1,'created','2023-02-07 11:53:11.052437','2023-02-07 11:53:11.052439',91,1,'INFO','De vigtigste punkter ved bekæmpelse af fluer er god gødningshåndtering og en generel god staldhygiejne.<br><br>Når du tager et billede af din serviceftale og/eller faktura på fluebekæmpelse, er den nem at finde frem på web, når du har brug for at kunne fremvise denne til f.eks. tilsynsmyndighederne.<br>',180,NULL,0),(181,1,'created','2023-02-07 11:53:11.174171','2023-02-07 11:53:11.174174',91,2,'INFO','<br>The most important points when controlling flies are good manure handling and a generally good stable hygiene.<br><br>When you take a picture of your service agreement and / or invoice for fly control, it is easy to find on the web when you need to be able to present it to e.g. supervisory authorities.',181,NULL,0),(182,1,'created','2023-02-07 11:53:11.540628','2023-02-07 11:53:11.540630',92,1,'Billede serviceaftale/faktura','',182,NULL,0),(183,1,'created','2023-02-07 11:53:11.578971','2023-02-07 11:53:11.578974',92,2,'Picture service agreement/invoice','',183,NULL,0),(184,1,'created','2023-02-07 11:53:11.759235','2023-02-07 11:53:11.759237',93,1,'Kommentar','',184,'',0),(185,1,'created','2023-02-07 11:53:11.862169','2023-02-07 11:53:11.862171',93,2,'Comment',