omme en alarm på anlægget. Her skal du følge producentens anvisninger.<br><br>I miljøgodkendelsen kan der være en række vilkår til egenkontrol i forhold til den installerede miljøteknologi.<br>',284,NULL,0),(285,1,'created','2023-02-07 11:53:37.211403','2023-02-07 11:53:37.211405',143,2,'INFO','<br>Used as an ammonia and odor-reducing measure in pig stables (sows, piglets and fattening pigs) with pipe release or line winch.<br><br>You must be aware of whether the heat pump has an hour meter, energy meter or a data logger.<br><br>If the heat pump has an hour meter and or energy meter, an annual consumption should be registered in order to be able to document that the heat pump runs smoothly.<br><br>If a fault occurs in the system, an alarm will sound on the system. Here you must follow the manufacturer\'s instructions.<br><br>In the environmental approval, there may be a number of conditions for self-inspection in relation to the installed environmental technology.<br>',285,NULL,0),(286,1,'created','2023-02-07 11:53:37.310348','2023-02-07 11:53:37.310350',144,1,'Sæt startdato for driftsstop','',286,'',0),(287,1,'created','2023-02-07 11:53:37.328961','2023-02-07 11:53:37.328963',144,2,'Set startdate for shutdown','',287,'',0),(288,1,'created','2023-02-07 11:53:37.597262','2023-02-07 11:53:37.597264',145,1,'Sæt slutdato for driftsstop','',288,'',0),(289,1,'created','2023-02-07 11:53:37.698735','2023-02-07 11:53:37.698737',145,2,'Set end date for shutdown','',289,'',0),(290,1,'created','2023-02-07 11:53:38.089352','2023-02-07 11:53:38.089354',146,1,'Driftsstop timer','',290,'0',0),(291,1,'created','2023-02-07 11:53:38.193498','2023-02-07 11:53:38.193500',146,2,'Downtime hours','',291,'0',0),(292,1,'created','2023-02-07 11:53:38.501006','2023-02-07 11:53:38.501009',147,1,'Årsag til driftsstop','',292,'',0),(293,1,'created','2023-02-07 11:53:38.582464','2023-02-07 11:53:38.582466',147,2,'Cause of shutdown','',293,'',0),(294,1,'created','2023-02-07 11:53:38.701821','2023-0