-07 11:52:27.975809',16,1,'Mængde af førstehjælpsudstyr OK','',NULL,0),(31,1,'created','2023-02-07 11:52:28.081742','2023-02-07 11:52:28.081744',16,2,'Amount of first aid equipment OK','',NULL,0),(32,1,'created','2023-02-07 11:52:28.435435','2023-02-07 11:52:28.435438',17,1,'Medarbejder kender placering af førstehjælpskasse','',NULL,0),(33,1,'created','2023-02-07 11:52:28.539744','2023-02-07 11:52:28.539747',17,2,'Employee knows the location of the first aid kit','',NULL,0),(34,1,'created','2023-02-07 11:52:28.829206','2023-02-07 11:52:28.829208',18,1,'Billede','',NULL,0),(35,1,'created','2023-02-07 11:52:28.977488','2023-02-07 11:52:28.977490',18,2,'Picture','',NULL,0),(36,1,'created','2023-02-07 11:52:29.371614','2023-02-07 11:52:29.371617',19,1,'Kommentar','','',0),(37,1,'created','2023-02-07 11:52:29.557147','2023-02-07 11:52:29.557150',19,2,'Comment','','',0),(38,1,'created','2023-02-07 11:52:30.098808','2023-02-07 11:52:30.098809',20,1,'Gem registrering','','GEM',0),(39,1,'created','2023-02-07 11:52:30.313446','2023-02-07 11:52:30.313449',20,2,'Save registration','','SAVE',0),(40,1,'created','2023-02-07 11:52:32.125914','2023-02-07 11:52:32.125916',21,1,'LÆS MERE','',NULL,0),(41,1,'created','2023-02-07 11:52:32.252627','2023-02-07 11:52:32.252629',21,2,'READ MORE','',NULL,0),(42,1,'created','2023-02-07 11:52:32.647054','2023-02-07 11:52:32.647057',22,1,'INFO','For at minimere arbejdsulykker og andre skadelige virkninger på miljøet, skal der være opsat værnemidler på husdyrbruget.<br><br>Forskellige arbejdsopgaver kræver forskellige værnemidler, og alle medarbejderne skal være bekendte med disse.<br>',NULL,0),(43,1,'created','2023-02-07 11:52:32.813503','2023-02-07 11:52:32.813505',22,2,'INFO','<br>In order to minimize accidents at work and other harmful effects on the environment, protective equipment must be installed on livestock farms.<br><br>Different work tasks require different protective equipment, and all employees must be familiar with these.',NULL,0),(44,1,'created','2023-02-07 11:52:33.302860','2023-02-07 11:52:33.302862',23,1,'Relevante værnemidler til rådighed','',NULL,0),(45,1,'created','2023-02-07 11:52:33.534672','2023-02-07 11:52:33.534674',23,2,'Relevant protective equipment available','',NULL,0),(46,1,'created','2023-02-07 11:52:34.011077','2023-02-07 11:52:34.011387',24,1,'Medarbejder ved hvor værnemidler findes','',NULL,0),(47,1,'created','2023-02-07 11:52:34.253429','2023-02-07 11:52:34.274516',24,2,'Employee knows where protective equipment is available','',NULL,0),(48,1,'created','2023-02-07 11:52:35.038326','2023-02-07 11:52:35.038329',25,1,'Medarbejder er bekendt med korrekt brug af værnemidler','',NULL,0),(49,1,'created','2023-02-07 11:52:35.161958','2023-02-07 11:52:35.161960',25,2,'Employee is familiar with the correct use of protective equipment','',NULL,0),(50,1,'created','2023-02-07 11:52:35.677041','2023-02-07 11:52:35.677043',26,1,'Billede','',NULL,0),(51,1,'created','2023-02-07 11:52:35.861618','2023-02-07 11:52:35.861621',26,2,'Picture','',NULL,0),(52,1,'created','2023-02-07 11:52:36.239961','2023-02-07 11:52:36.239964',27,1,'Kommentar','','',0),(53,1,'created','2023-02-07 11:52:36.323386','2023-02-07 11:52:36.323389',27,2,'Comment','','',0),(54,1,'created','2023-02-07 11:52:36.659363','2023-02-07 11:52:36.659366',28,1,'Gem registrering','','GEM',0),(55,1,'created','2023-02-07 11:52:36.743191','2023-02-07 11:52:36.743193',28,2,'Save registration','','SAVE',0),(56,1,'created','2023-02-07 11:52:38.088659','2023-02-07 11:52:38.088662',29,1,'LÆS MERE','',NULL,0),(57,1,'created','2023-02-07 11:52:38.149475','2023-02-07 11:52:38.149477',29,2,'READ MORE','',NULL,0),(58,1,'created','2023-02-07 11:52:38.373084','2023-02-07 11:52:38.373086',30,1,'INFO','Kontrol af alarmsystem gennemføres ved fx at trække trykmålerne op ca. ½ meter over gylleoverfladen og vent et par minutter. Herefter skal der komme en alarm. Rens sensoren.<br><br>Vær opmærksom på, at trykmålerne kan tage skade ved omrøring. Trykmålerne kan evt. tages op, når der omrøres.<br>',NULL,0),(59,1,'created','2023-02-07 11:52:38.433513','2023-02-07 11:52:38.433515',30,2,'INFO','<br>Checking of the alarm system is carried out by, for example, pulling up the pressure gauges approx. ½ meters above the slurry surface and wait a few minutes. Then there should be an alarm. Clean the sensor.<br><br>Be aware that the pressure gauges can be damaged by stirring. The pressure gauges can possibly taken up when stirred.',NULL,0),(60,1,'created','2023-02-07 11:52:38.721483','2023-02-07 11:52:38.721485',31,1,'Alarmanlæg OK','',NULL,0),(61,1,'created','2023-02-07 11:52:38.741686','2023-02-07 11:52:38.741688',31,2,'Alarm system OK','',NULL,0),(62,1,'created','2023-02-07 11:52:39.075721','2023-02-07 11:52:39.075723',32,1,'Billede','',NULL,0),(63,1,'created','2023-02-07 11:52:39.181715','2023-02-07 11:52:39.181717',32,2,'Picture','',NULL,0),(64,1,'created','2023-02-07 11:52:39.575460','2023-02-07 11:52:39.575462',33,1,'Kommentar','','',0),(65,1,'created','2023-02-07 11:52:39.679239','2023-02-07 11:52:39.679241',33,2,'Comment','','',0),(66,1,'created','2023-02-07 11:52:39.968591','2023-02-07 11:52:39.968593',34,1,'Gem registrering','','GEM',0),(67,1,'created','2023-02-07 11:52:40.116392','2023-02-07 11:52:40.116394',34,2,'Save registration','','SAVE',0),(68,1,'created','2023-02-07 11:52:41.668246','2023-02-07 11:52:41.668247',35,1,'LÆS MERE','',NULL,0),(69,1,'created','2023-02-07 11:52:41.730803','2023-02-07 11:52:41.730805',35,2,'READ MORE','',NULL,0),(70,1,'created','2023-02-07 11:52:41.932410','2023-02-07 11:52:41.932412',36,1,'INFO','Hvis der ikke er fast overdækning på en gyllebeholder, skal der etableres flydelag på gylleoverfladen.&nbsp;<br><br>Det skal altid sikres, at der er et tæt flydelag. Flydelaget begrænser ammoniakfordampningen, hvilket giver en bedre gødningsværdi i gyllen.<br><br>Flydelaget skal dække hele beholderens overflade, dog må der gerne være en brudflade op til 3 m2 ved det dykkede indløb.&nbsp;<br><br>Flydelaget kan etableres med en fast gødning eller fx snittet halm.<br><br>Hvis kommunen konstaterer mangelfuldt flydelag ved to tilsyn indenfor 3 år, skal overdækning påbydes, undtagen i særlige tilfælde, hvis kommunen ud fra en konkret vurdering finder, at overtrædelsen er undskyldelig.<br>',NULL,0),(71,1,'created','2023-02-07 11:52:42.034112','2023-02-07 11:52:42.034114',36,2,'INFO','<br>If there is no fixed cover on a slurry tank, floating layers must be established on the slurry surface.<br><br>It must always be ensured that there is a tight floating layer. The floating layer limits the ammonia evaporation, which gives a better fertilizer value in the manure.<br><br>The floating layer must cover the entire surface of the container, however, there may be a breaking surface up to 3 m2 at the submerged inlet.<br><br>The floating layer can be established with a solid fertilizer or, for example, cut straw.<br><br>If the municipality finds a defective floating layer during two inspections within 3 years, cover must be imposed, except in special cases if the municipality, based on a specific assessment, finds that the violation is excusable.',NULL,0),(72,1,'created','2023-02-07 11:52:42.336706','2023-02-07 11:52:42.336708',37,1,'Flydelag OK','',NULL,0),(73,1,'created','2023-02-07 11:52:42.522424','2023-02-07 11:52:42.522426',37,2,'Floating layer OK','',NULL,0),(74,1,'created','2023-02-07 11:52:42.748323','2023-02-07 11:52:42.748326',38,1,'Vælg årsag til manglende flydelag','',NULL,0),(75,1,'created','2023-02-07 11:52:42.915766','2023-02-07 11:52:42.915768',38,2,'Select reason for lack of floating layer','',NULL,0),(76,1,'created','2023-02-07 11:52:45.323607','2023-02-07 11:52:45.323609',39,1,'Billede','',NULL,0),(77,1,'created','2023-02-07 11:52:45.388980','2023-02-07 11:52:45.388983',39,2,'Picture','',NULL,0),(78,1,'created','2023-02-07 11:52:45.651724','2023-02-07 11:52:45.651726',40,1,'Kommentar','','',0),(79,1,'created','2023-02-07 11:52:45.712840','2023-02-07 11:52:45.712841',40,2,'Comment','','',0),(80,1,'created','2023-02-07 11:52:46.039925','2023-02-07 11:52:46.039927',41,1,'Gem registrering','','GEM',0),(81,1,'created','2023-02-07 11:52:46.185772','2023-02-07 11:52:46.185775',41,2,'Save registration','','SAVE',0),(82,1,'created','2023-02-07 11:52:47.443547','2023-02-07 11:52:47.443548',42,1,'LÆS MERE','',NULL,0),(83,1,'created','2023-02-07 11:52:47.463930','2023-02-07 11:52:47.463933',42,2,'READ MORE','',NULL,0),(84,1,'created','2023-02-07 11:52:47.562809','2023-02-07 11:52:47.562811',43,1,'INFO','Det skal altid sikres, at gyllebeholderne, fortanke og opsamlingsbeholderne har den fornødne styrke og tæthed, så udslip forhindres. Minimum en gang om året kontrolleres beholderne for skader.<br><br>Tjek for skader på kablerne. Kabler under jorden kan kun inspiceres ved at grave, og de bør derfor ikke inspiceres, med mindre der er mistanke om lækage.<br><br>Tjek om der er huller på kabelomslutningen. Det kan oftest ses ved, at fedtet er løbet ud af omslutningen og har skabt mørke pletter på beholderen.<br><br>Fugemassen kan være mørnet, hvilket du også skal tjekke.<br><br>Få udbedret eventuelle skader med det samme af en sagkyndig.<br>',NULL,0),(85,1,'created','2023-02-07 11:52:47.583255','2023-02-07 11:52:47.583257',43,2,'INFO','<br>It must always be ensured that the slurry tanks, pre-tanks and collection tanks have the necessary strength and tightness, so that spills are prevented. Check the containers for damage at least once a year.<br><br>Check for damage to the cables. Underground cables can only be inspected by digging and should therefore not be inspected unless leakage is suspected.<br><br>Check for holes in the cable cover. This can most often be seen by the fact that the grease has run out of the enclosure and has created dark spots on the slurry tank.<br><br>The sealant may be softened, which you should also check.<br><br>Have any damage repaired immediately by an expert.',NULL,0),(86,1,'created','2023-02-07 11:52:48.013742','2023-02-07 11:52:48.013744',44,1,'Kabler OK','Der må ikke være synlige skader på kablerne.',NULL,0),(87,1,'created','2023-02-07 11:52:48.116629','2023-02-07 11:52:48.116630',44,2,'Cables OK','There must be no visible damage to the cables.',NULL,0),(88,1,'created','2023-02-07 11:52:48.346278','2023-02-07 11:52:48.346280',45,1,'Kabelomslutning OK','Huller på kabelomslutning kan oftest ses ved, at fedtet er løbet ud af omslutningen og har skabt mørke pletter på beholderen.',NULL,0),(89,1,'created','2023-02-07 11:52:48.388415','2023-02-07 11:52:48.388417',45,2,'Cable enclosure OK','Holes on the cable enclosure can most often be seen by the grease running out of the enclosure and creating dark stains on the container.',NULL,0),(90,1,'created','2023-02-07 11:52:48.740122','2023-02-07 11:52:48.740124',46,1,'Fugemassen OK','Fugemassen må ikke være mørnet.',NULL,0),(91,1,'created','2023-02-07 11:52:48.822156','2023-02-07 11:52:48.822158',46,2,'Sealant OK','The sealant must not be softened.',NULL,0),(92,1,'created','2023-02-07 11:52:49.107976','2023-02-07 11:52:49.107979',47,1,'Billede','',NULL,0),(93,1,'created','2023-02-07 11:52:49.189642','2023-02-07 11:52:49.189644',47,2,'Picture','',NULL,0),(94,1,'created','2023-02-07 11:52:49.536837','2023-02-07 11:52:49.536840',48,1,'Kommentar','','',0),(95,1,'created','2023-02-07 11:52:49.680025','2023-02-07 11:52:49.680028',48,2,'Comment','','',0),(96,1,'created','2023-02-07 11:52:49.859153','2023-02-07 11:52:49.859155',49,1,'Gem registrering','','GEM',0),(97,1,'created','2023-02-07 11:52:49.980151','2023-02-07 11:52:49.980153',49,2,'Save registration','','SAVE',0),(98,1,'created','2023-02-07 11:52:51.335659','2023-02-07 11:52:51.335662',50,1,'LÆS MERE','',NULL,0),(99,1,'created','2023-02-07 11:52:51.440559','2023-02-07 11:52:51.440561',50,2,'READ MORE','',NULL,0),(100,1,'created','2023-02-07 11:52:51.603439','2023-02-07 11:52:51.603440',51,1,'INFO','Tag billeder af foderindlægssedlerne.',NULL,0),(101,1,'created','2023-02-07 11:52:51.623913','2023-02-07 11:52:51.623915',51,2,'INFO','Take pictures of the feed package leaflets.',NULL,0),(102,1,'created','2023-02-07 11:52:51.791638','2023-02-07 11:52:51.791640',52,1,'Billede af foderindlægssedler','',NULL,0),(103,1,'created','2023-02-07 11:52:51.920418','2023-02-07 11:52:51.920420',52,2,'Picture of feed leaflets','',NULL,0),(104,1,'created','2023-02-07 11:52:52.170354','2023-02-07 11:52:52.170357',53,1,'Kommentar','','',0),(105,1,'created','2023-02-07 11:52:52.294998','2023-02-07 11:52:52.295001',53,2,'Comment','','',0),(106,1,'created','2023-02-07 11:52:52.416502','2023-02-07 11:52:52.416505',54,1,'Gem registrering','','GEM',0),(107,1,'created','2023-02-07 11:52:52.518315','2023-02-07 11:52:52.518317',54,2,'Save registration','','SAVE',0),(108,1,'created','2023-02-07 11:52:53.842091','2023-02-07 11:52:53.842094',55,1,'LÆS MERE','',NULL,0),(109,1,'created','2023-02-07 11:52:53.903410','2023-02-07 11:52:53.903411',55,2,'READ MORE','',NULL,0),(110,1,'created','2023-02-07 11:52:54.189580','2023-02-07 11:52:54.189582',56,1,'INFO','Halebid kan forekomme hos grise i alle aldersgrupper, men ses primært hos grise, som er mellem 30 og 70 kg eller i alderen tre til fem måneder.&nbsp;<br><br>Halebid hos grise er et velfærdsmæssigt problem, der skal tages hånd om, så snart det forekommer i besætningen.<br><br>Udviklingen fra mindre halebid til alvorlige halebid sker hurtigt. Desuden kan halebid hurtigt brede sig blandt grisene i en sti.<br>',NULL,0),(111,1,'created','2023-02-07 11:52:54.229436','2023-02-07 11:52:54.229438',56,2,'INFO','<br>Tail bites can occur in pigs of all age groups, but are seen primarily in pigs that are between 30 and 70 kg or aged three to five months.<br><br>Tail bite in pigs is a welfare issue that needs to be addressed as soon as it occurs in the herd.<br><br>The development from minor tail bites to severe tail bites happens quickly. In addition, tail bites can quickly spread among the pigs in a pen.<br>',NULL,0),(112,1,'created','2023-02-07 11:52:54.483241','2023-02-07 11:52:54.483243',57,1,'Stald/sektion','','0',0),(113,1,'created','2023-02-07 11:52:54.606672','2023-02-07 11:52:54.606675',57,2,'Stable/section:','','0',0),(114,1,'created','2023-02-07 11:52:54.916210','2023-02-07 11:52:54.916213',58,1,'Note','Fx sti, område i stald etc.','',0),(115,1,'created','2023-02-07 11:52:54.957202','2023-02-07 11:52:54.957204',58,2,'Note','Eg pen, area in stable etc.','',0),(116,1,'created','2023-02-07 11:52:55.177702','2023-02-07 11:52:55.177704',59,1,'Grad af halebid','<b>Mindre alvorlig haleskade</b><br>Halen er ikke varm og hævet. Generelt er der få skader i besætningen.<br><br><b>Alvorligt halebid</b><br>Halen er varm og hævet, og der er tegn på infektion. Der er flere halebid i besætningen.<br>',NULL,0),(117,1,'created','2023-02-07 11:52:55.343693','2023-02-07 11:52:55.343696',59,2,'Degree tail bite','<br><b>Minor tail injury</b><br>The tail is not hot and swollen. In general, there are few injuries in the herd.<br><br><b>Severe tail bite</b><br>The tail is warm and swollen and there are signs of infection. There are several tail bites in the herd.',NULL,0),(118,1,'created','2023-02-07 11:52:56.089247','2023-02-07 11:52:56.089249',60,1,'Billede','',NULL,0),(119,1,'created','2023-02-07 11:52:56.189366','2023-02-07 11:52:56.189368',60,2,'Picture','',NULL,0),(120,1,'created','2023-02-07 11:52:56.342696','2023-02-07 11:52:56.342698',61,1,'Kommentar til halebid','','',0),(121,1,'created','2023-02-07 11:52:56.445095','2023-02-07 11:52:56.445098',61,2,'Comment tail bite','','',0),(122,1,'created','2023-02-07 11:52:56.801180','2023-02-07 11:52:56.801182',62,1,'Risikovurdering','',NULL,0),(123,1,'created','2023-02-07 11:52:56.883394','2023-02-07 11:52:56.883396',62,2,'Risk assessment','',NULL,0),(124,1,'created','2023-02-07 11:52:57.177208','2023-02-07 11:52:57.177211',63,1,'Vand problem','Er der forhold omkring drikkevand og vandforsyning, der giver problemer i besætningen?<br>',N