te forebygges ved at sikre, at foder opbevares i tætte og dertil egnede beholdere.<br><br>Der vil kunne ske spild af foder fx ved utætte samlinger, levering/indblæsning af foder eller lignende. Sker der spild af foder, er det vigtigt, at der løbende bliver samlet op, så fx tilhold af rotter undgås.',NULL,0),(167,1,'created','2023-02-07 11:53:08.116392','2023-02-07 11:53:08.116394',84,2,'INFO','<br>Feed must be stored in such a way that pests are prevented and spills do not give rise to point pollution.<br><br>This is prevented by ensuring that feed is stored in tight and suitable containers.<br><br>There may be a waste of feed, for example by leaky joints, delivery / supply of feed or the like. If there is a waste of feed, it is important that it is collected regularly, so that, for example, the presence of rats is avoided.',NULL,0),(168,1,'created','2023-02-07 11:53:08.484007','2023-02-07 11:53:08.484009',85,1,'Ingen foderspild','',NULL,0),(169,1,'created','2023-02-07 11:53:08.562387','2023-02-07 11:53:08.562388',85,2,'No feed spills','',NULL,0),(170,1,'created','2023-02-07 11:53:08.743183','2023-02-07 11:53:08.743185',86,1,'Rørsamlinger tætte','',NULL,0),(171,1,'created','2023-02-07 11:53:08.847883','2023-02-07 11:53:08.847885',86,2,'Pipe joints tight','',NULL,0),(172,1,'created','2023-02-07 11:53:08.970653','2023-02-07 11:53:08.970655',87,1,'Billede','',NULL,0),(173,1,'created','2023-02-07 11:53:09.012974','2023-02-07 11:53:09.012976',87,2,'Picture','',NULL,0),(174,1,'created','2023-02-07 11:53:09.068309','2023-02-07 11:53:09.068311',88,1,'Kommentar','','',0),(175,1,'created','2023-02-07 11:53:09.087269','2023-02-07 11:53:09.087272',88,2,'Comment','','',0),(176,1,'created','2023-02-07 11:53:09.274534','2023-02-07 11:53:09.274536',89,1,'Gem registrering','','GEM',0),(177,1,'created','2023-02-07 11:53:09.312811','2023-02-07 11:53:09.312814',89,2,'Save registration','','SAVE',0),(178,1,'created','2023-02-07 11:53:10.661892','2023-02-07 11:53:10.661894',90,1,'LÆS MERE','',NULL,0),(179,1,'created','2023-02-07 11:53:10.785501','2023-02-07 11:53:10.785503',90,2,'READ MORE','',NULL,0),(180,1,'created','2023-02-07 11:53:11.052437','2023-02-07 11:53:11.052439',91,1,'INFO','De vigtigste punkter ved bekæmpelse af fluer er god gødningshåndtering og en generel god staldhygiejne.<br><br>Når du tager et billede af din serviceftale og/eller faktura på fluebekæmpelse, er den nem at finde frem på web, når du har brug for at kunne fremvise denne til f.eks. tilsynsmyndighederne.<br>',NULL,0),(181,1,'created','2023-02-07 11:53:11.174171','2023-02-07 11:53:11.174174',91,2,'INFO','<br>The most important points when controlling flies are good manure handling and a generally good stable hygiene.<br><br>When you take a picture of your service agreement and / or invoice for fly control, it is easy to find on the web when you need to be able to present it to e.g. supervisory authorities.',NULL,0),(182,1,'created','2023-02-07 11:53:11.540628','2023-02-07 11:53:11.540630',92,1,'Billede serviceaftale/faktura','',NULL,0),(183,1,'created','2023-02-07 11:53:11.578971','2023-02-07 11:53:11.578974',92,2,'Picture service agreement/invoice','',NULL,0),(184,1,'created','2023-02-07 11:53:11.759235','2023-02-07 11:53:11.759237',93,1,'Kommentar','','',0),(185,1,'created','2023-02-07 11:53:11.862169','2023-02-07 11:53:11.862171',93,2,'Comment','','',0),(186,1,'created','2023-02-07 11:53:12.046473','2023-02-07 11:53:12.046475',94,1,'Gem registrering','','GEM',0),(187,1,'created','2023-02-07 11:53:12.064996','2023-02-07 11:53:12.064998',94,2,'Save registration','','SAVE',0),(188,1,'created','2023-02-07 11:53:13.274357','2023-02-07 11:53:13.274359',95,1,'LÆS MERE','',NULL,0),(189,1,'created','2023-02-07 11:53:13.334310','2023-02-07 11:53:13.334313',95,2,'READ MORE','',NULL,0),(190,1,'created','2023-02-07 11:53:13.699709','2023-02-07 11:53:13.699711',96,1,'INFO','Effektive virkemidler mod rotter er orden, ryddelighed, fejede gulve, fjernelse af vegetation langs bygninger, reparation af huller/rørgennemføringer, at døre/porte for så vidt muligt holdes lukkede og at oplag af “diverse” sættes på paller og strøer.<br><br>Når du tager et billede af din serviceftale og/eller faktura på rottebekæmpelse, er den nem at finde frem på web, når du har brug for at kunne fremvise denne til f.eks. tilsynsmyndighederne.<br>',NULL,0),(191,1,'created','2023-02-07 11:53:13.840523','2023-02-07 11:53:13.840525',96,2,'INFO','<br>Effective measures against rats are order, tidiness, swept floors, removal of vegetation along buildings, repair of holes / pipe penetrations, that doors / gates are kept closed as far as possible and that storage of \"miscellaneous\" is placed on pallets and joists.<br><br>When you take a picture of your service agreement and / or invoice for rat control, it is easy to find on the web when you need to be able to present it to e.g. supervisory authorities.',NULL,0),(192,1,'created','2023-02-07 11:53:14.068101','2023-02-07 11:53:14.068103',97,1,'Billede serviceaftale/faktura','',NULL,0),(193,1,'created','2023-02-07 11:53:14.107272','2023-02-07 11:53:14.107274',97,2,'Picture service agreement/invoice','',NULL,0),(194,1,'created','2023-02-07 11:53:14.204358','2023-02-07 11:53:14.204360',98,1,'Kommentar','','',0),(195,1,'created','2023-02-07 11:53:14.288571','2023-02-07 11:53:14.288573',98,2,'Comment','','',0),(196,1,'created','2023-02-07 11:53:14.454296','2023-02-07 11:53:14.454298',99,1,'Gem registrering','','GEM',0),(197,1,'created','2023-02-07 11:53:14.537075','2023-02-07 11:53:14.537077',99,2,'Save registration','','SAVE',0),(198,1,'created','2023-02-07 11:53:16.157312','2023-02-07 11:53:16.157315',100,1,'LÆS MERE','',NULL,0),(199,1,'created','2023-02-07 11:53:16.261472','2023-02-07 11:53:16.261473',100,2,'READ MORE','',NULL,0),(200,1,'created','2023-02-07 11:53:16.486678','2023-02-07 11:53:16.486680',101,1,'INFO','Bruges som ammoniak- og lugtreducerende tiltag i svinestalde og kan være stillet som et vilkår i husdyrbrugets mil