(280,1,'created','2023-02-07 11:53:35.401605','2023-02-07 11:53:35.401608',141,1,'Gem registrering','','GEM',0),(281,1,'created','2023-02-07 11:53:35.485278','2023-02-07 11:53:35.485281',141,2,'Save registration','','SAVE',0),(282,1,'created','2023-02-07 11:53:36.800985','2023-02-07 11:53:36.800987',142,1,'LÆS MERE','',NULL,0),(283,1,'created','2023-02-07 11:53:36.882618','2023-02-07 11:53:36.882621',142,2,'READ MORE','',NULL,0),(284,1,'created','2023-02-07 11:53:37.190973','2023-02-07 11:53:37.190976',143,1,'INFO','Bruges som ammoniak- og lugtreducerende tiltag i svinestalde (søer, smågrise og slagtesvin) med rørudslusning eller linespil.<br><br>Du skal være opmærksom på, om varmepumpen er med timetæller, energimåler eller en datalogger.<br><br>Hvis varmepumpen har en timetæller og/eller energimåler, bør der registreres årligt timeforbrug/energimåling for at kunne dokumentere, at varmepumpen kører jævnt.<br><br>Hvis der opstår fejl på anlægget, vil der komme en alarm på anlægget. Her skal du følge producentens anvisninger.<br><br>I miljøgodkendelsen kan der være en række vilkår til egenkontrol i forhold til den installerede miljøteknologi.<br>',NULL,0),(285,1,'created','2023-02-07 11:53:37.211403','2023-02-07 11:53:37.211405',143,2,'INFO','<br>Used as an ammonia and odor-reducing measure in pig stables (sows, piglets and fattening pigs) with pipe release or line winch.<br><br>You must be aware of whether the heat pump has an hour meter, energy meter or a data logger.<br><br>If the heat pump has an hour meter and or energy meter, an annual consumption should be registered in order to be able to document that the heat pump runs smoothly.<br><br>If a fault occurs in the system, an alarm will sound on the system. Here you must follow the manufacturer\'s instructions.<br><br>In the environmental approval, there may be a number of conditions for self-inspection in relation to the installed environmental technology.<br>',NULL,0),(286,1,'created','2023-02-07 11:53:37.31034