ringer fra skrothandler, genbrugsplads eller lignende.<br><br>For farligt affald skal der være særlig opmærksomhed på opbevaringen indtil bortskaffelse, så det sikres, at der ikke sker miljøbelastning.<br>&nbsp;<br>Opbevaringen af døde dyr må ikke give anledning til uhygiejniske forhold eller risiko for forurening af jord, grundvand eller overfladevand.<br>',NULL,0),(343,1,'created','2023-02-07 11:53:50.005624','2023-02-07 11:53:50.005626',172,2,'INFO','<br>The municipality\'s commercial waste regulations must be followed.<br><br>It must always be possible to document how waste has been disposed of. For example in the form of receipts from scrap dealers, recycling sites or the like.<br><br>For hazardous waste, special attention must be paid to storage until disposal to ensure that there is no environmental impact.<br><br>The storage of dead animals must not give rise to unhygienic conditions or the risk of contamination of soil, groundwater or surface water.<br>',NULL,0),(344,1,'created','2023-02-07 11:53:50.230393','2023-02-07 11:53:50.230395',173,1,'Billede kvittering','',NULL,0),(345,1,'created','2023-02-07 11:53:50.332670','2023-02-07 11:53:50.332673',173,2,'Picture receipts','',NULL,0),(346,1,'created','2023-02-07 11:53:50.572733','2023-02-07 11:53:50.572735',174,1,'Kommentar','','',0),(347,1,'created','2023-02-07 11:53:50.653484','2023-02-07 11:53:50.653486',174,2,'Comment','','',0),(348,1,'created','2023-02-07 11:53:50.857210','2023-02-07 11:53:50.857212',175,1,'Gem registrering','','GEM',0),(349,1,'created','2023-02-07 11:53:51.002086','2023-02-07 11:53:51.002087',175,2,'Save registration','','SAVE',0),(350,1,'created','2023-02-07 11:53:52.195634','2023-02-07 11:53:52.195637',176,1,'LÆS MERE','',NULL,0),(351,1,'created','2023-02-07 11:53:52.255015','2023-02-07 11:53:52.255018',176,2,'READ MORE','',NULL,0),(352,1,'created','2023-02-07 11:53:52.519740','2023-02-07 11:53:52.519742',177,1,'INFO','Opbevaring af dieselolie skal ske i godkendte tanke. Tankene skal være placeret, så risiko for påkørsel minimeres, og så eventuelt spild kan opsamles eller håndteres uden risiko for afstrømning til det omkringliggende miljø.<br><br>Slanger og tankhaner skal være tætte og alle tanke skal være registreret i BBR. Der skal desuden være tankattest og læsbar mærkat med tanktype og alder.&nbsp;<br><br>Et olieabsorberende materiale, eksempelvis kattegrus, skal til enhver tid være let tilgængeligt i umiddelbar nærhed af alle ejendommens&nbsp; dieseltanke, således at spild omgående og effektivt kan opsamles.<br>',NULL,0),(353,1,'created','2023-02-07 11:53:52.599736','2023-02-07 11:53:52.599738',177,2,'INFO','<br>Storage of diesel oil must take place in approved tanks. The tanks must be located so that the risk of collision is minimized, and so that any waste can be collected or handled without risk of run-off to the surrounding environment.<br><br>Hoses and tank valves must be tight and all tanks must be registered in the BBR. There must be a tank certificate and a legible sticker with tank type and age.<br><br>An oil-absorbent material, such as cat litter, must at all times be easily accessible in the immediate vicinity of all the property\'s diesel tanks, so that spills can be collected immediately and efficiently.',NULL,0),(354,1,'created','2023-02-07 11:53:52.779682','2023-02-07 11:53:52.779685',178,1,'Tankattest OK','',NULL,0),(355,1,'created','2023-02-07 11:53:52.839216','2023-02-07 11:53:52.839219',178,2,'Tank certificate OK','',NULL,0),(356,1,'created','2023-02-07 11:53:53.231735','2023-02-07 11:53:53.231738',179,1,'Ingen spild og utætheder','',NULL,0),(357,1,'created','2023-02-07 11:53:53.333241','2023-02-07 11:53:53.333242',179,2,'No spills and leaks','',NULL,0),(358,1,'created','2023-02-07 11:53:53.623356','2023-02-07 11:53:53.623359',180,1,'Slange til diesel OK','',NULL,0),(359,1,'created','2023-02-07 11:53:53.640285','2023-02-07 11:53:53.640287',180,2,'Hose for diesel OK','',NULL,0),(360,1,'created','2023-02-07 11:53:53.905834','2023-02-07 11:53:53.905836',181,1,'Adgang til olieabsorberende materiale','',NULL,0),(361,1,'created','2023-02-07 11:53:53.924944','2023-02-07 11:53:53.924946',181,2,'Access to oil absorbent material','',NULL,0),(362,1,'created','2023-02-07 11:53:54.150525','2023-02-07 11:53:54.150528',182,1,'Billede','',NULL,0),(363,1,'created','2023-02-07 11:53:54.236685','2023-02-07 11:53:54.236687',182,2,'Picture','',NULL,0),(364,1,'created','2023-02-07 11:53:54.514503','2023-02-07 11:53:54.514505',183,1,'Kommentar','','',0),(365,1,'created','2023-02-07 11:53:54.599004','2023-02-07 11:53:54.599006',183,2,'Comment','','',0),(366,1,'created','2023-02-07 11:53:54.843966','2023-02-07 11:53:54.843969',184,1,'Gem registrering','','GEM',0),(367,1,'created','2023-02-07 11:53:54.862226','2023-02-07 11:53:54.862228',184,2,'Save registration','','SAVE',0),(368,1,'created','2023-02-07 11:53:56.000426','2023-02-07 11:53:56.000428',185,1,'LÆS MERE','',NULL,0),(369,1,'created','2023-02-07 11:53:56.104545','2023-02-07 11:53:56.104547',185,2,'READ MORE','',NULL,0),(370,1,'created','2023-02-07 11:53:56.356001','2023-02-07 11:53:56.356003',186,1,'INFO','Pesticider skal altid opbevares utilgængeligt for uvedkommende - altså bag lås.&nbsp;Pesticider skal være godkendte og forsynet med dansk etikette.<br>&nbsp;<br>Der må ikke være afløb i gulvet, hvor pesticider opbevares.<br><br>Vejledning om værnemidler og korrekt anvendelse skal være tilgængelig. Værnemidler skal være tilgængelige.<br>',NULL,0),(371,1,'created','2023-02-07 11:53:56.395381','2023-02-07 11:53:56.395383',186,2,'INFO','<br>Pesticides must always be kept out of the reach of unauthorized persons - ie behind locks. Pesticides must be approved and provided with Danish etiquette.<br><br>There must be no drains in the floor where pesticides are stored.<br><br>Guidance on protective equipment and proper use must be available. Protective equipment must be available.',NULL,0),(372,1,'created','2023-02-07 11:53:56.730320','2023-02-07 11:53:56.730322',187,1,'Kemitjek','',NULL,0),(373,1,'created','2023-02-07 11:53:56.791978','2023-02-07 11:53:56.791980',187,2,'Chemistry check','',NULL,0),(374,1,'created','2023-02-07 11:53:57.018498','2023-02-07 11:53:57.018500',188,1,'Ingen spild og utætte beholdere','',NULL,0),(375,1,'created','2023-02-07 11:53:57.080169','2023-02-07 11:53:57.080171',188,2,'No spills and leaky containers','',NULL,0),(376,1,'created','2023-02-07 11:53:57.241751','2023-02-07 11:53:57.241753',189,1,'Værnemidler tilgængelig','',NULL,0),(377,1,'created','2023-02-07 11:53:57.346369','2023-02-07 11:53:57.346371',189,2,'Protective equipment available','',NULL,0),(378,1,'created','2023-02-07 11:53:57.642246','2023-02-07 11:53:57.642248',190,1,'Billede','',NULL,0),(379,1,'created','2023-02-07 11:53:57.766980','2023-02-07 11:53:57.766982',190,2,'Picture','',NULL,0),(380,1,'created','2023-02-07 11:53:57.978232','2023-02-07 11:53:57.978234',191,1,'Kommentar','','',0),(381,1,'created','2023-02-07 11:53:58.081040','2023-02-07 11:53:58.081042',191,2,'Comment','','',0),(382,1,'created','2023-02-07 11:53:58.332218','2023-02-07 11:53:58.332220',192,1,'Gem registrering','','GEM',0),(383,1,'created','2023-02-07 11:53:58.413603','2023-02-07 11:53:58.413605',192,2,'Save registration','','SAVE',0),(384,1,'created','2023-02-07 11:53:59.589905','2023-02-07 11:53:59.589907',193,1,'LÆS MERE','',NULL,0),(385,1,'created','2023-02-07 11:53:59.696247','2023-02-07 11:53:59.696250',193,2,'READ MORE','',NULL,0),(386,1,'created','2023-02-07 11:54:00.007234','2023-02-07 11:54:00.007236',194,1,'INFO','Opbevaring af både spildolie og ny motorolie skal ske i dertil egnede beholdere.&nbsp;Alle beholdere skal være placeret på fast gulv uden afløb.&nbsp;<br><br>Beholdere kan være placeret i spildbakke eller lignende, der som minimum kan rumme indholdet af den største beholder.<br><br>Bortskaffelse af spildolie, filtre mm. skal ske efter gældende regler og skal kunne dokumenteres.<br><br>Spildolie ikke må anvendes til smøring etc.<br><br>Vær opmærksom på kommunernes erhvervsaffaldsregulativ i forbindelse med fx bortskaffelseshyppighed mv.&nbsp;<br>',NULL,0),(387,1,'created','2023-02-07 11:54:00.193439','2023-02-07 11:54:00.193441',194,2,'INFO','<br>Both waste oil and new engine oil must be stored in suitable containers. All containers must be placed on a solid floor without a drain.<br><br>Containers can be placed in a waste bin or similar, which can at least hold the contents of the largest container.<br><br>Disposal of waste oil, filters etc. must be done according to current rules and must be able to be documented.<br><br>Waste oil must not be used for lubrication etc.<br><br>Pay attention to the municipalities\' commercial waste regulations in connection with, for example, disposal frequency, etc.',NULL,0),(388,1,'created','2023-02-07 11:54:00.457434','2023-02-07 11:54:00.457436',195,1,'Tankattest OK','',NULL,0),(389,1,'created','2023-02-07 11:54:00.539063','2023-02-07 11:54:00.539065',195,2,'Tank certificate OK','',NULL,0),(390,1,'created','2023-02-07 11:54:00.835139','2023-02-07 11:54:00.835141',196,1,'Ingen spild og utætheder','',NULL,0),(391,1,'created','2023-02-07 11:54:00.897938','2023-02-07 11:54:00.897940',196,2,'No spills and leaks','',NULL,0),(392,1,'created','2023-02-07 11:54:01.124552','2023-02-07 11:54:01.124554',197,1,'Adgang til olieabsorberende materiale','',NULL,0),(393,1,'created','2023-02-07 11:54:01.251229','2023-02-07 11:54:01.251232',197,2,'Access to oil absorbent material','',NULL,0),(394,1,'created','2023-02-07 11:54:01.409938','2023-02-07 11:54:01.409940',198,1,'Billede','',NULL,0),(395,1,'created','2023-02-07 11:54:01.452158','2023-02-07 11:54:01.452160',198,2,'Picture','',NULL,0),(396,1,'created','2023-02-07 11:54:01.680249','2023-02-07 11:54:01.680251',199,1,'Kommentar','','',0),(397,1,'created','2023-02-07 11:54:01.829559','2023-02-07 11:54:01.829561',199,2,'Comment','','',0),(398,1,'created','2023-02-07 11:54:02.120672','2023-02-07 11:54:02.120674',200,1,'Gem registrering','','GEM',0),(399,1,'created','2023-02-07 11:54:02.245815','2023-02-07 11:54:02.245817',200,2,'Save registration','','SAVE',0),(400,1,'created','2023-02-07 11:54:03.059344','2023-02-07 11:54:03.059346',201,1,'LÆS MERE OM APV HANDLINGSPLAN','',NULL,0),(401,1,'created','2023-02-07 11:54:03.180427','2023-02-07 11:54:03.180429',202,1,'INFO','Alle virksomheder med ansatte skal udarbejde en skriftlig arbejdspladsvurdering (APV). APV´en er virksomhedens eget redskab til at kortlægge, prioritere og løse eventuelle arbejdsmiljøproblemer.<br><br>Tjeklisten indeholder en række spørgsmål, som virksomhedens medarbejdere skal besvare. Resultatet af undersøgelsen viser indenfor hvilke områder, der&nbsp;evt. er et arbejdsmiljøproblem.<br><br>Eventuelle arbejdsmiljøproblemer skal indgå i den handlingsplan, som virksomheden skal udarbejde.<br><br>APV-tjeklisten henvender sig især til virksomheder med under ti ansatte.',NULL,0),(402,1,'created','2023-02-07 11:54:03.324370','2023-02-07 11:54:03.324373',203,1,'Navn og adresse på bedrift','','',0),(403,1,'created','2023-02-07 11:54:03.542295','2023-02-07 11:54:03.542297',204,1,'Problem','<br>','',0),(404,1,'created','2023-02-07 11:54:03.790362','2023-02-07 11:54:03.790364',205,1,'Løsning','<br>','',0),(405,1,'created','2023-02-07 11:54:04.139542','2023-02-07 11:54:04.139545',206,1,'Vigtighed','',NULL,0),(406,1,'created','2023-02-07 11:54:05.213275','2023-02-07 11:54:05.213277',207,1,'Deadline','','',0),(407,1,'created','2023-02-07 11:54:05.543398','2023-02-07 11:54:05.543401',208,1,'Status','',NULL,0),(408,1,'created','2023-02-07 11:54:07.448826','2023-02-07 11:54:07.448828',209,1,'01. Fald til lavere niveau','Er der risiko for, at I kan falde ned fra fx stiger, plansiloer, gallerier eller bygningen?<br>',NULL,0),(409,1,'created','2023-02-07 11:54:07.486388','2023-02-07 11:54:07.486390',209,2,'01. Fall to lower level','<br>Is there a risk that you may fall from ladders, plan silos, galleries or the building?',NULL,0),(410,1,'created','2023-02-07 11:54:08.679000','2023-02-07 11:54:08.679002',210,1,'02. Ulykker med maskiner','Er der risiko for at komme til skade med de maskiner, I bruger til fx høst, fodertilberedning eller gyllehåndtering?<br>',NULL,0),(411,1,'created','2023-02-07 11:54:08.739120','2023-02-07 11:54:08.739122',210,2,'02. Accidents with machines','<br>Is there a risk of injury with the machines you use for eg harvesting, feed preparation or slurry handling?',NULL,0),(412,1,'created','2023-02-07 11:54:09.789920','2023-02-07 11:54:09.789922',211,1,'03. Akut fysisk overbelastning','Er der risiko for akut overbelastning af kroppen, når I løfter, driver med dyr, trækker eller skubber fx kalve og&nbsp;grise eller tunge materialer på bedriften?<br>',NULL,0),(413,1,'created','2023-02-07 11:54:09.854116','2023-02-07 11:54:09.854119',211,2,'03. Acute physical overload','<br>Is there a risk of acute overload of the body when you lift, drive animals, pull or push eg calves and pigs or heavy materials on the farm?',NULL,0),(414,1,'created','2023-02-07 11:54:11.030087','2023-02-07 11:54:11.030089',212,1,'04. Fald og snublen','Er der risiko for, at I kan falde eller snuble over fx rod eller paller i stalden, laden, maskinhuset eller udendørs,&nbsp;eller fordi der er glat på plansiloen, i stalden eller udendørs?<br>',NULL,0),(415,1,'created','2023-02-07 11:54:11.093327','2023-02-07 11:54:11.093329',212,2,'04. Fall and stumble','<br>Is there a risk that you may fall or stumble over, for example, clutter or pallets in the barn, barn, machine house or outdoors, or because it is slippery on the flat silo, in the barn or outdoors?',NULL,0),(416,1,'created','2023-02-07 11:54:11.976370','2023-02-07 11:54:11.976372',213,1,'05. Ulykker med håndværktøj og håndmaskiner','Er der risiko for at skære sig eller at få fingrene i klemme, når I arbejder med håndværktøj som fx kanyler,&nbsp;boltpistoler, motorsave, vinkelslibere og boremaskiner?<br>',NULL,0),(417,1,'created','2023-02-07 11:54:11.995827','2023-02-07 11:54:11.995829',213,2,'05. Accidents with hand tools and hand machines','<br>Is there a risk of cutting yourself or getting your fingers pinched when working with hand tools such as needles, bolt guns, chainsaws, angle grinders and drills?',NULL,0),(418,1,'created','2023-02-07 11:54:13.344318','2023-02-07 11:54:13.344320',214,1,'06. Intern færdsel','Er der risiko for, at I kan blive påkørt eller klemt af fx traktorer, knækstyrede frontlæssere og fladvogne, når I&nbsp;kører på ejendommen?<br>',NULL,0),(419,1,'created','2023-02-07 11:54:13.464472','2023-02-07 11:54:13.464475',214,2,'06. Internal traffic','<br>Is there a risk that you may be hit or crushed by eg tractors, articulated front loaders and flatbed trucks when driving on the property?',NULL,0),(420,1,'created','2023-02-07 11:54:14.386774','2023-02-07 11:54:14.386776',215,1,'07. Dårlige arbejdsstillinger','Arbejder I med foroverbøjet ryg, løftede arme, på hug eller i andre dårlige arbejdsstillinger, eller står og går I det&nbsp;meste af arbejdsdagen?<br>',NULL,0),(421,1,'created','2023-02-07 11:54:14.447222','2023-02-07 11:54:14.447224',215,2,'07. Poor working positions','<br>Do you work with your back bent, your arms raised, squatting or in other bad working positions, or do you stand and walk most of the working day?',NULL,0),(422,1,'created','2023-02-07 11:54:15.532172','2023-02-07 11:54:15.532174',216,1,'08. Ensidigt, belastende arbejde','Belaster I kroppen på samme måde over længere tid – fx når I udfører pløjning med drejet nakke, kastrerer&nbsp;mange smågrise, eller aftørrer og afrenser yvere?<br>',NULL,0),(423,1,'created','2023-02-07 11:54:15.570414','2023-02-07 11:54:15.570416',216,2,'08. One-sided, stressful work','<br>Do you strain your body in the same way for a long time - for example when you plow with a twisted neck, castrate many piglets, or wipe and clean udders?',NULL,0),(424,1,'created','2023-02-07 11:54:16.879386','2023-02-07 11:54:16.879388',217,1,'09. Tunge løft','Løfter I sække med foder, maskindele, kalve eller andre tunge emner på bedriften?<br>',NULL,0),(425,1,'created','2023-02-07 11:54:16.983442','2023-02-07 11:54:16.983444',217,2,'09. Heavy lifting','<br>Do you lift sacks of feed, machine parts, calves or other heavy items on the farm?',NULL,0),(426,1,'created','2023-02-07 11:54:18.014176','2023-02-07 11:54:18.014177',218,1,'10. Træk og skub','Bruger I mange kræfter, når I skal trække eller skubbe fx tunge trillebøre, fodervogne, palleløftere eller&nbsp;kadavervogne?<br>',NULL,0),(427,1,'created','2023-02-07 11:54:18.137444','2023-02-07 11:54:18.137446',218,2,'10. Pull and push','<br>Do you use a lot of force when you have to pull or push, for example, heavy wheelbarrows, feed carts, pallet trucks or carcass carts?',NULL,0),(428,1,'created','2023-02-07 11:54:18.877274','2023-02-07 11:54:18.877277',219,1,'11. Høj støj','Arbejder I med vinkelslibere, motorsave og højtryksrensere eller andre meget støjende maskiner?<br>',NULL,0),(429,1,'created','2023-02-07 11:54:19.003441','2023-02-07 11:54:19.003443',219,2,'11. Loud noise','<br>Do you work with angle grinders, chainsaws and high pressure cleaners or other very noisy machines?',NULL,0),(430,1,'created','2023-02-07 11:54:20.070505','2023-02-07 11:54:20.070507',220,1,'12. Stor arbejdsmængde, tidspres og uklare krav','Har I ofte for mange opgaver eller for travlt i bedriften?<br>',NULL,0),(431,1,'created','2023-02-07 11:54:20.152591','2023-02-07 11:54:20.152593',220,2,'12. Large workload, time pressure and unclear requirements','<br>Do you often have too many tasks or too busy on the farm?',NULL,0),(432,1,'created','2023-02-07 11:54:21.274431','2023-02-07 11:54:21.274433',221,1,'13. Hjælp og støtte fra ledelse og kolleger','Mangler I hjælp og støtte fra jeres ledelse og kolleger?<br>',NULL,0),(433,1,'created','2023-02-07 11:54:21.356592','2023-02-07 11:54:21.356594',221,2,'13. Help and support from management and colleagues','<br>Do you lack help and support from your management and colleagues?',NULL,0),(434,1,'created','2023-02-07 11:54:22.462024','2023-02-07 11:54:22.462026',222,1,'14. Mobning','Er der nogen på arbejdspladsen, der bliver udsat for mobning?<br>',NULL,0),(435,1,'created','2023-02-07 11:54:22.563793','2023-02-07 11:54:22.563795',222,2,'14. Bullying','<br>Is anyone in the workplace being bullied?',NULL,0),(436,1,'created','2023-02-07 11:54:23.745549','2023-02-07 11:54:23.745551',223,1,'15. Infektionsrisiko','Er der risiko for infektioner eller luftvejsbelastninger, når I arbejder med dyr?<br>',NULL,0),(437,1,'created','2023-02-07 11:54:23.829713','2023-02-07 11:54:23.829715',223,2,'15. Risk of infection','<br>Is there a risk of infections or respiratory loads when working with animals?',NULL,0),(438,1,'created','2023-02-07 11:54:24.898895','2023-02-07 11:54:24.898897',224,1,'16. Farlige stoffer og materialer','Arbejder I med faremærkede produkter som fx bekæmpelsesmidler, desinficeringsmidler, rengøringsmidler og&nbsp;flydende ammoniak eller med andre produkter som fx gødning, antibiotika og andre veterinærlægemidler, der&nbsp;kan indeholde farlige stoffer og materialer?<br>',NULL,0),(439,1,'created','2023-02-07 11:54:25.021699','2023-02-07 11:54:25.021701',224,2,'16. Hazardous substances and materials','<br>Do you work with hazardous products such as pesticides, disinfectants, cleaning agents and liquid ammonia or with other products such as fertilizers, antibiotics and other veterinary medicines that may contain dangerous substances and materials?',NULL,0),(440,1,'created','2023-02-07 11:54:25.661575','2023-02-07 11:54:25.661577',225,1,'17. Støv, gasser og røg','Er der risiko for, at I bliver udsat for støv, gas eller røg fra flis, hø, halm, korn, gylle, fisk der rådner, ensilage,&nbsp;udstødning eller svejsning?<br>',NULL,0),(441,1,'created','2023-02-07 11:54:25.743531','2023-02-07 11:54:25.743533',225,2,'17. Dust, gases and fumes','<br>Is there a risk that you will be exposed to dust, gas or smoke from wood chips, hay, straw, grain, manure, rotting fish, silage, exhaust or welding?',NULL,0),(442,1,'created','2023-02-07 11:54:26.635042','2023-02-07 11:54:26.635045',226,1,'18. Våde eller fugtige hænder','Arbejder I med våde eller fugtige hænder i mere end 2 timer om dagen?<br>',NULL,0),(443,1,'created','2023-02-07 11:54:26.673407','2023-02-07 11:54:26.673409',226,2,'18. Wet or damp hands','<br>Do you work with wet or damp hands for more than 2 hours a day?',NULL,0),(444,1,'created','2023-02-07 11:54:27.819826','2023-02-07 11:54:27.819828',227,1,'19. Helkropsvibrationer','Kører I med traktorer, høstmateriel, minilæssere og andre maskiner, der udsætter jer for kraftige vibrationer?<br>',NULL,0),(445,1,'created','2023-02-07 11:54:27.901043','2023-02-07 11:54:27.901045',227,2,'19. Whole body vibrations','<br>Do you drive with tractors, harvesting equipment, mini loaders and other machines that expose you to strong vibrations?',NULL,0),(446,1,'created','2023-02-07 11:54:29.165702','2023-02-07 11:54:29.165704',228,1,'20. Hånd-armvibrationer','Har I snurrende eller følelsesløse fingre, når I har arbejdet med meget vibrerende værktøj som fx motorsave,&nbsp;højtryksrensere og vinkelslibere?<br>',NULL,0),(447,1,'created','2023-02-07 11:54:29.249213','2023-02-07 11:54:29.249214',228,2,'20. Hand-arm vibrations','<br>Do you have tingling or numb fingers when you have worked with very vibrating tools such as chainsaws, high-pressure cleaners and angle grinders?',NULL,0),(448,1,'created','2023-02-07 11:54:30.522159','2023-02-07 11:54:30.522162',229,1,'21. Alt i alt oplever jeg, at arbejdsforholdende er gode på min arbejdsplads','',NULL,0),(449,1,'created','2023-02-07 11:54:30.584380','2023-02-07 11:54:30.584382',229,2,'21. All in all, I find that working conditions are good in my workplace','',NULL,0),(450,1,'created','2023-02-07 11:54:31.402416','2023-02-07 11:54:31.402417',230,1,'Kommentarer til arbejdsforholdende','','',0),(451,1,'created','2023-02-07 11:54:31.508458','2023-02-07 11:54:31.508460',230