on','','SAVE',0),(592,1,'created','2023-02-07 11:56:00.520890','2023-02-07 11:56:00.520892',301,1,'LÆS MERE','',NULL,0),(593,1,'created','2023-02-07 11:56:00.910540','2023-02-07 11:56:00.910542',301,2,'READ MORE','',NULL,0),(594,1,'created','2023-02-07 11:56:02.016335','2023-02-07 11:56:02.016338',302,1,'INFO','Egenkontrolprogrammet, der er en del af DANISH Produkt-standard, skal som minimum kontrolleres én gang årligt, og underskrives af den ansvarlige for besætningen, hvilket vil blive kontrolleret ved DANISH-besøg. Som vejledning til punkterne vedrørende dyrevelfærd, henvises til \"Vejledning om god dyrevelfærd i besætninger med grise\".<br>',NULL,0),(595,1,'created','2023-02-07 11:56:02.559348','2023-02-07 11:56:02.559351',302,2,'INFO','<br>The self-inspection program, which is part of the DANISH Product Standard, must be inspected at least once a year and signed by the person in charge of the crew, which will be inspected during DANISH visits. For guidance on animal welfare items, please refer to \"Vejledning om god dyrevelfærd i besætninger med grise\".',NULL,0),(596,1,'created','2023-02-07 11:56:03.910926','2023-02-07 11:56:03.910929',303,1,'Branchekode for god produktionspraksis i primærproduktionen er udfyldt og underskrevet.','',NULL,0),(597,1,'created','2023-02-07 11:56:04.450676','2023-02-07 11:56:04.450678',303,2,'Industry code for good production practice in primary production is filled in and signed.','',NULL,0),(598,1,'created','2023-02-07 11:56:06.088762','2023-02-07 11:56:06.088765',304,1,'Der er dokumentation for alle udførte dyrlægebesøg. Besøgsrapporterne gemmes i to år.','',NULL,0),(599,1,'created','2023-02-07 11:56:06.528433','2023-02-07 11:56:06.528435',304,2,'There is documentation for all performed veterinary visits. The visit reports are stored for two years.','',NULL,0),(600,1,'created','2023-02-07 11:56:07.838318','2023-02-07 11:56:07.838320',305,1,'Hvis der er indgået en sundheds-rådgivningsaftale, kan denne fremvises, og er der udfærdiget  handlingsplaner i relation til målrettet dyrevelfærdsindsats, kan disse også fremvises.','',NULL,0),(601,1,'created','2023-02-07 11:56:08.420078','2023-02-07 11:56:08.420079',305,2,'If a health advisory agreement has been entered into, this can be presented, and if action plans have been drawn up in relation to targeted animal welfare efforts, these can also be presented.','',NULL,0),(602,1,'created','2023-02-07 11:56:09.509325','2023-02-07 11:56:09.509327',306,1,'Alle dyr tilses mindst en gang dagligt.','',NULL,0),(603,1,'created','2023-02-07 11:56:10.007746','2023-02-07 11:56:10.007749',306,2,'All animals are inspected at least once a day.','',NULL,0),(604,1,'created','2023-02-07 11:56:10.948869','2023-02-07 11:56:10.948871',307,1,'Her kontrolleres også at: ','',NULL,0),(605,1,'created','2023-02-07 11:56:11.363670','2023-02-07 11:56:11.363672',307,2,'Here it is also checked that:','',NULL,0),(606,1,'created','2023-02-07 11:56:12.337941','2023-02-07 11:56:12.337943',308,1,'a. Alle dyr har vand og foder.','',NULL,0),(607,1,'created','2023-02-07 11:56:12.792772','2023-02-07 11:56:12.792774',308,2,'a. All animals have water and food.','',NULL,0),(608,1,'created','2023-02-07 11:56:13.993601','2023-02-07 11:56:13.993603',309,1,'b. Arealkravene er overholdt.','',NULL,0),(609,1,'created','2023-02-07 11:56:14.302535','2023-02-07 11:56:14.302537',309,2,'b. The area requirements have been complied with.','',NULL,0),(610,1,'created','2023-02-07 11:56:15.133216','2023-02-07 11:56:15.133218',310,1,'c. Alle dyr kan rejse, lægge og hvile sig uden besvær.','',NULL,0),(611,1,'created','2023-02-07 11:56:15.692933','2023-02-07 11:56:15.692936',310,2,'c. All animals can get up, lie down and rest without difficulty.','',NULL,0),(612,1,'created','2023-02-07 11:56:16.942812','2023-02-07 11:56:16.942814',311,1,'d. Gulvene ikke er glatte eller ujævne.','',NULL,0),(613,1,'created','2023-02-07 11:56:17.311691','2023-02-07 11:56:17.311693',311,2,'d. The floors are not slippery or uneven.','',NULL,0),(614,1,'created','2023-02-07 11:56:17.749162','2023-02-07 11:56:17.749164',312,1,'Alt automatiseret eller mekanisk udstyr efterses mindst én gang om dagen.','',NULL,0),(615,1,'created','2023-02-07 11:56:17.920173','2023-02-07 11:56:17.920175',312,2,'All automated or mechanical equipment is inspected at least once a day.','',NULL,0),(616,1,'created','2023-02-07 11:56:18.236660','2023-02-07 11:56:18.236662',313,1,'Det sikres, at alle indgreb (kastration, halekupering, tandslibning og jernbehandling) foretages efter lovgivningen, og at der udvises fornøden omhu og hygiejne.','',NULL,0),(617,1,'created','2023-02-07 11:56:18.275027','2023-02-07 11:56:18.275029',313,2,'It is ensured that all procedures (castration, tail docking, tooth grinding and iron treatment) are carried out in accordance with the law, and that the necessary care and hygiene is exercised.','',NULL,0),(618,1,'created','2023-02-07 11:56:18.655676','2023-02-07 11:56:18.655679',314,1,'Fra 1. januar 2019 er alle halebid registreret.','',NULL,0),(619,1,'created','2023-02-07 11:56:18.823855','2023-02-07 11:56:18.823857',314,2,'From 1 January 2019, all tail bites are registered.','',NULL,0),(620,1,'created','2023-02-07 11:56:19.133035','2023-02-07 11:56:19.133037',315,1,'Fra 1. april 2019 foreligger der en opdateret risikovurdering og handlingsplan.','',NULL,0),(621,1,'created','2023-02-07 11:56:19.235533','2023-02-07 11:56:19.235536',315,2,'From 1 April 2019, there will be an updated risk assessment and action plan.','',NULL,0),(622,1,'created','2023-02-07 11:56:19.593652','2023-02-07 11:56:19.593655',316,1,'Fra 1. juli 2019 er der ved salg af halekuperede smågrise, både i Danmark og udland, indhentet dokumentation fra modtageren eller mellemhandleren om, at der er behov for at modtage halekuperede grise.','',NULL,0),(623,1,'created','2023-02-07 11:56:19.653671','2023-02-07 11:56:19.653674',316,2,'From 1 July 2019, when selling tail docking piglets, both in Denmark and abroad, documentation has been obtained from the recipient or middleman that there is a need to receive tail docking pigs.','',NULL,0),(624,1,'created','2023-02-07 11:56:20.136644','2023-02-07 11:56:20.136646',317,1,'Der foreligger en målsætning med initiativer, der øger pattegrise-overlevelsen. Denne målsætning følges op årligt.','',NULL,0),(625,1,'created','2023-02-07 11:56:20.285874','2023-02-07 11:56:20.285876',317,2,'There is an objective with initiatives that increase piglet survival. This objective is followed up annually.','',NULL,0),(626,1,'created','2023-02-07 11:56:20.576715','2023-02-07 11:56:20.576718',318,1,'Syge, tilskadekomne og aggressive dyr bliver om nødvendigt isoleret, evt. flyttet til sygesti og evt. behandlet. Det sikres, at der er nok sygestier, og at disse er indrettet korrekt. Det sikres, at der føres ekstra tilsyn ved sammenblanding af dyr, for hurtigt at kunne gribe ind.','',NULL,0),(627,1,'created','2023-02-07 11:56:20.925713','2023-02-07 11:56:20.925715',318,2,'Sick, injured and aggressive animals are isolated if necessary moved to sick pen and treatment. It is ensured that there are enough sick pens and that these are arranged correctly. It is ensured that extra supervision is carried out when mixing animals, in order to be able to intervene quickly.','',NULL,0),(628,1,'created','2023-02-07 11:56:21.276950','2023-02-07 11:56:21.276953',319,1,'Ved det daglige tilsyn kontrolleres, om der er tilfælde af halebid og/eller skuldersår. Eventuelle nye tilfælde sættes i behandling.','',NULL,0),(629,1,'created','2023-02-07 11:56:21.425491','2023-02-07 11:56:21.425494',319,2,'During the daily inspection, check whether there are cases of tail bites and / or shoulder ulcers. Any new cases are put into treatment.','',NULL,0),(630,1,'created','2023-02-07 11:56:21.715310','2023-02-07 11:56:21.715312',320,1,'Der forefindes velfungerende boltpistol samt en skarp kniv til afblødning og/eller udstyr til rygmarvsstødning.','',NULL,0),(631,1,'created','2023-02-07 11:56:21.839734','2023-02-07 11:56:21.839736',320,2,'There is a well-functioning bolt gun as well as a sharp knife for de-bleeding and / or equipment for spinal cord impact.','',NULL,0),(632,1,'created','2023-02-07 11:56:22.342849','2023-02-07 11:56:22.342851',321,1,'Det overvåges, at alle grise har permanent adgang til en tilstrækkelig mængde halm eller andet manipulerbart materiale, der kan opfylde deres behov for beskæftigelses- og rodemateriale.','',NULL,0),(633,1,'created','2023-02-07 11:56:22.447078','2023-02-07 11:56:22.447080',321,2,'It is monitored that all pigs have permanent access to a sufficient amount of straw or other manipulable material that can meet their need for recreational material.','',NULL,0),(634,1,'created','2023-02-07 11:56:22.826694','2023-02-07 11:56:22.826696',322,1,'Det sikres, at det kun er transportegnede grise, der flyttes til udleverings-faciliteterne (udleveringsrummet). I tvivlstilfælde flyttes grisene til en særskilt sti, hvor vognmanden, eventuelt en dyrlæge, vurderer dyrenes transportegnethed. Der skal foreligge dokumentation fra dyrlægen om årlig gennemgang af faktaark fra SEGES om transportegnethed.','',NULL,0),(635,1,'created','2023-02-07 11:56:22.998280','2023-02-07 11:56:22.998282',322,2,'It is ensured that only transportable pigs are moved to the delivery facilities (delivery room). In case of doubt, the pigs are moved to a separate pen, where the haulier, possibly a veterinarian, assesses the animals\' transportability. There must be documentation from the veterinarian about the annual review of fact sheets from SEGES on transport suitability.','',NULL,0),(636,1,'created','2023-02-07 11:56:23.202369','2023-02-07 11:56:23.202371',323,1,'Billede','',NULL,0),(637,1,'created','2023-02-07 11:56:23.391095','2023-02-07 11:56:23.391097',323,2,'Picture','',NULL,0),(638,1,'created','2023-02-07 11:56:23.962984','2023-02-07 11:56:23.962986',324,1,'Kommentar','','',0),(639,1,'created','2023-02-07 11:56:24.084772','2023-02-07 11:56:24.084774',324,2,'Co